import styled from "styled-components";
import { animated } from "react-spring";

export const OverlayContainer = styled(animated.div)`
  position: relative;
  z-index: 99999;
  width: 100%;
  height: 100%;
  background: #e5edec;
`;
export const OverCloseIcon = styled(animated.div)``;
